import { useFetch } from "../hooks/useFetch";


const Pokemones = () => {
  const { data, results, error, loading } = useFetch(
    "https://pokeapi.co/api/v2/pokemon/?limit=10"
  );
  

  if (loading) {
    return <h2>loading...</h2>;
  }
  if (error !== "") {
    return <h2>{error}</h2>;
  }

  return (
    <div>
      <h1>Bienvenido maestro pokem√≥n</h1>
      {data.map((item) => (
        <h4 key={item.name}>
          
            {item.ype} - {item.url}
         
        </h4>
      ))}
    </div>
  );
};

export default Pokemones;
